// Helper functions
func getLanguageIcon(language string) string {
	switch language {
	case "go":
		return "deployed_code"
	case "python":
		return "code"
	case "javascript", "typescript":
		return "javascript"
	case "java":
		return "coffee"
	default:
		return "code"
	}
}

func getIssueIcon(issueType string) string {
	switch issueType {
	case "error":
		return "error"
	case "warning":
		return "warning"
	case "info":
		return "info"
	default:
		return "info"
	}
}

func getSuggestionIcon(suggestionType string) string {
	switch suggestionType {
	case "optimization":
		return "speed"
	case "refactor":
		return "build"
	case "security":
		return "security"
	case "style":
		return "palette"
	default:
		return "lightbulb"
	}
}

func filterToolsByCategory(tools []DevelopmentTool, category string) []DevelopmentTool {
	var filtered []DevelopmentTool
	for _, tool := range tools {
		if tool.Category == category {
			filtered = append(filtered, tool)
		}
	}
	return filtered
}

